import React from 'react';
import '../styles/Pages.css';
import {Container, Row, Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import suitFight from '../assets/img/png0.png';
import poseMiguel from '../assets/img/png1.png';

function ImgHome() {
    return(
        <>
            <Container fluid className="ImgHome">
                <Row>
                    <Col xs={12} sm={12} md={4} lg={4}>
                        <div className="imgLayers">
                            <div className="suitFight">
                                <img src={suitFight} />
                            </div>
                            <div className="poseMiguel" id="poseMiguel">
                                <img src={poseMiguel} />
                            </div>
                        </div>
                    </Col>
                </Row>
            </Container>
        </>
    )
}

export default ImgHome;
